    function handleSubmit(e) {

        e.preventDefault();   
      }

    return ( 
        <div className="login">
            <img src={logo} width={70} height={50}/>
            <h2>InvestSavvy</h2>
            {/* <span role="img" aria-label="rocket">ðŸš€</span> */}
