                    <label>Password:</label>
                    <input type="password" required 
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                    />
                </pre>

                <button disabled={!validateForm()}>Submit</button>
                <pre></pre>
                <a href = "/signup">Don't have an account?</a>
            </form>
        </div>
     );
}

export default Login;
